import React from "react";

export default function DisclaimerModal({ onAccept }) {
  return (
    <div style={{
      position: "fixed", top: 0, left: 0, right: 0, bottom: 0,
      background: "rgba(0,0,0,0.5)", display: "flex",
      justifyContent: "center", alignItems: "center", zIndex: 1000
    }}>
      <div style={{ background: "white", padding: 30, borderRadius: 10, textAlign: "center" }}>
        <h2>Welcome to SafeBite</h2>
        <p>Please note that allergen information is based on available data and may not be completely accurate.</p>
        <p>By using this app, it is a declaration you accept this information.</p>
        <button onClick={onAccept} style={{ marginTop: 20 }}>I Accept</button>
      </div>
    </div>
  );
}
